-- correct too small chances 
-- dosen't make sense and doesn't make fun if you have a chance of 1 of 10.000
UPDATE loot_creatures SET normal10percentchance=0.1 WHERE ( normal10percentchance>0 AND normal10percentchance<0.1 );
UPDATE loot_creatures SET normal25percentchance=0.1 WHERE ( normal25percentchance>0 AND normal25percentchance<0.1 );
UPDATE loot_creatures SET heroic10percentchance=0.1 WHERE ( heroic10percentchance>0 AND heroic10percentchance<0.1 );
