UPDATE loot_gameobjects SET heroic25percentchance=0.1 WHERE ( heroic25percentchance>0 AND heroic25percentchance<0.1 );

UPDATE loot_fishing SET normal10percentchance=0.05 WHERE ( normal10percentchance>0 AND normal10percentchance<0.05 );
