-- quest item (chance was too low)
UPDATE loot_creatures SET normal10percentchance=normal10percentchance*10, normal25percentchance=normal25percentchance*10, heroic10percentchance=heroic10percentchance*10, heroic25percentchance=heroic25percentchance*10 WHERE itemid=7906;

-- 20.4.2013 too much resistance -> http://arcemu.org/forums/index.php?showtopic=26701
UPDATE creature_proto SET resistance1=resistance1/30 WHERE resistance1>1000;
UPDATE creature_proto SET resistance2=resistance2/30 WHERE resistance2>1000;
UPDATE creature_proto SET resistance3=resistance3/30 WHERE resistance3>1000;
UPDATE creature_proto SET resistance4=resistance4/30 WHERE resistance4>1000;
UPDATE creature_proto SET resistance5=resistance5/30 WHERE resistance5>1000;
UPDATE creature_proto SET resistance6=resistance6/30 WHERE resistance6>1000;

UPDATE creature_waypoints SET position_z=position_z-10 WHERE spawnid IN (48276, 48277, 48278, 48279, 48280) AND position_z>0;

